export function logos(plusLang = {}) {
    var src = "";
    var images = [
        "data:image/png;base64,",
        "data:image/png;base64,",
        "data:image/png;base64,",
        "data:image/png;base64,",
        "data:image/png;base64,"
    ];
    let eq = {};
    var img;
    var lastidx = 0;
    var urlre = /^((http|https|ftp):\/\/)?(\w(\:\w)?@)?([0-9a-z_-]+\.)*?([a-z0-9-]+\.[a-z]{2,6}(\.[a-z]{2})?(\:[0-9]{2,6})?)((\/[^?#<>\/\\*":]*)+(\?[^#]*)?(#.*)?)?$/i;

    function procSignal(signal, value) {
        if (value[0] == "logoFaceUrl") {
            if (value[1] == 'n') {
                kernel.setProp('logoFaceUrl', 'n');
            } else if (value[1] == 'u') {
                if (value[2] == 'modify') {
                    var input = prompt(BGIMAGE_URL, src);
                    if (urlre.exec(input)) {
                        src = input;
                        kernel.setProp('logoSticker', src);
                        $(document).trigger('logoStickerChange');
                    } else {
                        alert(BGIMAGE_INVALID);
                    }
                }
            } else {
                lastidx = value[1];
                if (lastidx in eq) {
                    lastidx = eq[lastidx];
                }
                kernel.setProp('logoSticker', images[lastidx]);
                if (value[2] == 'modify') {
                    if (value[1] == 0) kernel.setProp('logoFace', '2');
                    if (value[1] == 1) kernel.setProp('logoFace', '5');
                    if (value[1] == 2 || value[1] == 3 || value[1] == 4 || value[1] == 'cbb' || value[1] == 'cv') kernel.setProp('logoFace', '3');
                }
                $(document).trigger('logoStickerChange');
            }
            setTimeout(function() {
                kernel.pushSignal('scramble', tools.getCurScramble());
            }, 1000)
        }
    }

    $(function() {
        kernel.regListener('logoSticker', 'property', procSignal, /^logoFaceUrl$/);
        let idx = ['n', 'u', 0, 1, 2, 3, 4];
        let names = BGIMAGE_IMAGE_STR.split('|').slice(0, -1).concat('csTimer+', 'biocube', 'fellowcube', 'speedcubereview', 'lightscameracubing');
        if (kernel.getProp('lang') == 'pt-pt') {
            idx.push('cbb', 'cv');
            names.push('cuber brasil', 'cubovelocidade');
            images.push(
                'data:image/png;base64,',
                'data:image/png;base64,'
            );
            let relative = images.length - 2;
            eq = {cbb: relative, cv: relative+1};
        }
        kernel.regProp('color', 'logoFaceUrl', 1, plusLang.PLUS_LOGO_IMAGE, ['n', idx, names]);
        kernel.regProp('color', 'logoFace', 1, plusLang.PLUS_LOGO_FACE, ['3', ['0', '1', '2', '3', '4', '5'], plusLang.PLUS_LOGO_FACE_OPT.split('|')]);
    });
}